urls: /get-started#uploading-data
headings: Get Started, Uploading Data
paragraph: My goal with MakeGPT is to simplify the process of integrating and uploading data to the Stack, allowing you to make the most of your data in queries. In the future, I plan to develop native integrations, making it as easy as pressing a few buttons to start feeding data from your datasource to the Stack. For now, you can use the "Ingestion endpoint" to push data to the Stack by sending a POST request with the following payload: {
  "type": "object",
  "properties": {
    "uuid": {
      "type": "string"
    },
    "urls": {
      "type": "array",
      "items": {
        "type": "string"
      }
    },
    "headings": {
      "type": "array",
      "items": {
        "type": "string"
      }
    },
    "paragraph": {
      "type": "string"
    },
    "tokens": {
      "type": "number",
      "description": "Optional, if you don't want the endpoint to calculate tokens, leave this empty for now"
    },
    "embeddings": {
      "type": "array",
      "description": "Optional, if you don't want the endpoint to calculate embeddings, leave this empty for now",
      "items": {
        "type": "number"
      }
    }
  }
} If you don't provide tokens and embeddings, the endpoint will calculate them using your OpenAI configuration. The response will contain the following object: 
  { "type": "object",
  "properties": {
    "timeElapsedMS": {
      "type": "object",
      "properties": {
        "tokenizer": {
          "type": "number"
        },
        "embedding_calculator": {
          "type": "number"
        },
        "index_update": {
          "type": "number"
        },
        "clean_up": {
          "type": "number"
        }
      }
    },
    "tokens": {
      "type": "number"
    },
    "embeddings": {
      "type": "number"
    }
  }
} 
I highly recommend saving a copy of the data, particularly the tokens and embeddings, in your own system. Since calculating these values can be costly, storing them will not only help you manage expenses but also facilitate easy migration to a different Stack in the future.

urls: /get-started#stack-usage
headings: Get Started, Stack testing and usage, Websocket
paragraph: Each stack enables you to connect with your ChatGPT integration through a WebSocket endpoint, with some stacks also providing a REST endpoint. To test your integration, every stack offers a client application. By clicking its link, the client will open and establish a connection with your stack via the WebSocket. The request body which is expected by the socket is as following :  {
  "type": "object",
  "properties": {
    "query": {
      "type": "string"
    },
    "temperature": {
      "type": "float",
      "default": 0.7
    },
    "max_response_tokens": {
      "type": "int",
      "default": 3000
    },
    "external_context": {
      "type": "string",
      "default": " "
    },
    "vector_records_to_fetch": {
      "type": "int",
      "default": 10
    },
    "just_build_context": {
      "type": "bool",
      "default": false
    },
    "max_context_tokens": {
      "type": "int",
      "default": 10000
    },
    "chat_history": {
      "type": "array",
      "default": [],
      "items": {
        "type": "object",
        "properties": {
          "type": {
            "type": "string"
          },
          "content": {
            "type": "string"
          }
        }
      }
    },
    "client_src": {
      "type": "string",
      "default": "web"
    },
    "frequency_penalty": {
      "type": "float",
      "default": 0
    },
    "presence_penalty": {
      "type": "float",
      "default": 0
    },
    "prompt_id": {
      "type": "string",
      "default": "default"
    },
    "user_id": {
      "type": "string"
    },
    "__debug": {
      "type": "boolean",
      "default": false
    }
  }
}

